@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM a owl:Class .
atm:Function a owl:Class .
atm:withdrawal a atm:Function .
atm:StateValue a owl:Class .
atm:successful a atm:StateValue .
atm:initiated a atm:StateValue .
atm:Item a owl:Class .
atm:transaction a atm:Item .

atm:hasInitialFunctionSequence rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Function .

atm:hasStateValue rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Function ;
    rdfs:range atm:StateValue .

atm:shallSet rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Item .

atm:hasItemState rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Item ;
    rdfs:range atm:StateValue .

[ a owl:Class ;
  owl:equivalentClass [ a owl:Restriction ;
                        owl:onProperty atm:hasInitialFunctionSequence ;
                        owl:someValuesFrom [ a owl:Restriction ;
                                             owl:onProperty atm:hasStateValue ;
                                             owl:hasValue atm:successful ] ] ;
  rdfs:subClassOf [ a owl:Restriction ;
                    owl:onProperty atm:shallSet ;
                    owl:someValuesFrom [ a owl:Restriction ;
                                         owl:onProperty atm:hasItemState ;
                                         owl:hasValue atm:initiated ] ] ] .
